def three_sum(nums)
  nums = nums.sort
  len = nums.length
  store = Set.new
  result = []

  for i in 0...len
    next if i > 0 && nums[i] == nums[i-1]
    store.clear
    
    j = i+1
    while j < len
        # puts j
      complement = -nums[i] - nums[j]
      if store.include?(complement)
          result << [nums[i], nums[j], complement]
          # puts j, result.inspect
          while j < len && nums[j] == nums[j-1]
            
              j += 1
          end 
      end
      store << nums[j] if j < len
      j +=1 
    end
  end
  return result
end
